", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "207": ["Отличное качество!!\nПришло во время,в упаковке с целлофане.\nМагнит сильный, даже очень, заказывал для громоздкого Samsung Galaxy S20A в чехле держит хорошо даже в бездорожье.\nСоветую данный товар!", "2021-01-22T12:18:51Z", "черный", "0", 2, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "208": ["Отличная штука. Читала в отзывах, что плохо держится клейкая основа. В итоге, приклеив и обнаружив, что не совсем ровно, я не смогла больше отодрать корпус держателя от панели.\nДва магнита, которые ставятся под силиконовый чехол тоже отлично фиксируют телефон на держателе. Пыталась смахнуть телефон рукой, но он лишь поворачивался в другую сторону. Я удивляюсь людям, которые пишут, что магнит плохо держит и тел \"летает по салону\". Чушь!!!  Слетать будет, только если у вас  Моторолла 2000 г, весом в 0.5кг", "2021-01-22T10:00:45Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "209": ["Без комментариев.", "2021-01-21T09:41:09Z", "черный", "0", 0, 1, 3, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "210": ["Советую приобрести данный автомобильный держатель.\nМагнит супер!!!", "2021-01-21T08:42:29Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "213": ["Он такой малыш 😍\nНо такой прекрасный, стильный, крепкий, одно удовольствие.\nРазмер очень удивил, думала намного больше, а тут вместе с коробкой в ладошке помещается.\nРекомендую к покупке!", "2021-01-19T19:43:28Z", "черный", "0", 3, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "217": ["Все супер \nНадеюсь не отлипнет", "2020-12-25T12:05:14Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "220": ["Держатель просто суперррр. Компактный, занимает очень мало места, можно пристроить в любое место торпеды. Клейкая основа