ашину в салоне прогрейте, а потом наносите и не сразу вешайте свой кирпич, дайте ему укрепиться на поверхности. Не читайте этих горе комментаторов. Просто надо соблюдать условия\nЗа свою цену отличный держатель \nИз минусов , шарнира очень жёсткая , боялся ее сломать , когда хотел ее сдвинуть в первый раз , капнул в шарниру силикона и все стало прекрасно.", "2020-12-27T15:37:26Z", "черный", "0", 8, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "257": ["Хорошая вещь,  держит хорошо.", "2020-11-14T04:09:53Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "259": ["Хорошо держит, качественный! ", "2020-12-26T16:18:00Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "260": ["Все пи шло быстро. Товар хороший", "2020-12-26T12:10:08Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "261": ["Магнит хороший. Товар пришел целый. Соответствует описанию.", "2020-12-26T11:22:56Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "262": ["Отличный держатель.", "2020-12-26T08:17:09Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "263": ["Приклеить хорошо, держит телефон отлично", "2020-12-26T03:49:11Z", "черный", "0", 2, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "264": ["Отличный держатель ", "2020-12-25T15:59:21Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "265": ["Пользуюсь 3 дня держит хорошо. Рекомендую", "2020-12-25T07:14:41Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "266": ["Советую! Товар отличный ", "2020-12-24T17:11:40Z", "черный", "0", 1, 0, 5, "Автомобильный держатель для телефона CH-115 в авто", "Defender"], "268": ["Хороший магнит. Можно брать", "2020-12-24T07:38:23Z", "черный", "0", 1, 0, 5, "Ав